@section(Temperature Limiting Factor)

The "AtmosphericTemperature VegetationLimitingFactor causing Vegetation Growth" model calculates the effect of mean temperature (value of AtmosphericTemperature over Vegetation model) on vegetation growth @cite(Coughenour1994) . To be calculated, the models @cite(Tappeiner1998) are used:

•	"AtmosphericTemperature causing Vegetation Growth" model: Temperature that produces maximum growth

•	"Minimum AtmosphericTemperature VegetationLimitingFactor causing Vegetation Growth" model: Temperature below which vegetation stops growing 

•	"Maximum AtmosphericTemperature VegetationLimitingFactor causing Vegetation Growth" model: Temperature above which vegetation stops growing
